//로고가 포함된 작은 사이즈의 툴


function Logo(){
    return(
        <div>
            <img src="logo_DTCA.png" alt="이미지 업로드 오류"
            width = "150px"
            />
        </div>
    );
}

function LogoAdd(){
    return(
        <div>
            <img src="logoAdd.png" alt="이미지 업로드 오류"
            width = "150px"
            />
        </div>
    );
}


export default Logo;
